import BannerTop from './component/BannerTop';
import Card from './component/Card';
import Header from './component/header';
import Hero from './component/Hero';
import Step from './component/Step';
import Footer from './component/Footer'
import Testimonial from './component/Testimonial';
import logo from './logo.svg';
import "./tailwindcss/style.css"
import { useState } from 'react';
import FormEmail from './component/formEmail';
import UseProps from './component/props';


function App() {
  const [count , setCount] = useState(0)
  return (
    <div className="App">
    <BannerTop></BannerTop>
    <Header></Header>
    <Hero></Hero>
    <Card></Card>
    <Card></Card>
    <Card></Card>
    <Step></Step>
    <Testimonial></Testimonial>
    <FormEmail count={count} setCount={setCount}></FormEmail>
    <UseProps name="quyết"></UseProps>
    <UseProps name="linh"></UseProps>
    <UseProps name="quyết"></UseProps>
    <Footer></Footer>
    </div>
  );
}

export default App;
